//Dialog Box to select params for Graph generation
import * as React from "react";

// importing material UI components
import AppBar from "@mui/material/AppBar";
import Toolbar from "@mui/material/Toolbar";
import Button from "@mui/material/Button";

export default function SubHeader(props) {
    // const style = {
    //     background = '#2E3B55',
    // };
    const {nodes=200, types = [{label:"SQUARE GRID",value:"SQR"},{label:"BINARY BALANCED",value:"BIN"}]} = props

return (
	<AppBar position="static" style={{ background: '#FFFFFF', color: '#0288D1'}}>
		<Toolbar variant="dense">
        <p>Select nodes</p>
		<Button disabled = {!s1} color="inherit" sx={{ flexGrow: 1 }} onClick={(nodes) => nodes-1}>-</Button>
		<Input disabled = {true} color="inherit" sx={{ flexGrow: 1 }} onClick={onGenerate}>{nodes}</Input>
		<Button disabled = {!s1} color="inherit" sx={{ flexGrow: 1 }} onClick={(nodes) => nodes+1}>+</Button>
		<div sx={{ flexGrow: 1 }}>
            <label> Select the type of graph 
                <select value={props.value} onChange={props.onChange}>
                    {types.map((option) => (
                        <option value={option.value}>{option.label}</option>
                    ))}
                </select>
            </label>
        </div>
		<Button color="deepblue" sx={{ flexGrow: 1 }} onClick={onSelect}>Generate</Button>
		</Toolbar>
	</AppBar>
);
}
